Ext.data.JsonP['Studio_4.7.1.GA_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Studio 4.7.1.GA - 13 September 2016</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46256866\" class=\"content\">\n                        <h1>Studio 4.7.1.GA - 13 September 2016</h1>\n    <p>Studio 4.7.1.GA is a patch release that includes one bug fix.    </p>\n    <div class=\"section section-2 \" id=\"src-46256866_Studio4.7.1.GAReleaseNote-FixedIssue\">\n        <h2 class=\"heading \"><span>Fixed Issue</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-8580\" target=\"_blank\">TISTUD-8580</a> - iOS: Studio doesn&apos;t detect WatchOS 3 sims    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46256866\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Studio 4.7.1.GA Release Note"});